INSERT INTO `family_mem_special` VALUES (0,0,'一般','無特殊補助身分'),(1,1,'服役中','應徵（召）服兵役'),(2,0,'產業訓儲或第3階段替代','產業訓儲或第3階段替代役若有收入、動產、不動產仍須詳實填寫並列計'),(3,1,'榮民領有生活費','榮民領有院外就養生活費'),(4,1,'就學領有公費','就學領有公費'),(5,1,'通緝或服刑','正在通緝中或正判刑在執行中或入獄服刑、或因案遭羈押或拘禁'),(6,1,'失蹤有案','失蹤經向警察機關報案協尋未獲達六個月以上'),(7,1,'災難失蹤','遭遇特別災難失蹤經證明者'),(8,1,'政府安置','經政府公費安置收容並負擔其全部費用'),(9,1,'無設籍外、陸配','未設籍之外配或陸配'),(10,1,'無扶養事實之直系尊親屬','未共同生活且無扶養事實之特殊境遇單親家庭直系血親尊親屬'),(11,1,'未盡照顧職責之父母','未與單親家庭未成年子女共同生活、無扶養事實，且未行使、負擔其對未成年子女權利義務之父或母'),(12,1,'父母離異而分離之兄弟姊妹','因父母離異而未與共同生活之兄弟姊妹'),(13,1,'無國籍','喪失國籍'),(14,1,'其他','其他'),(30,2,'55歲以上,16歲以下無收入','五十五歲以上或十六歲以下而無固定收入'),(31,2,'身心障礙、重大傷病','身心障礙手冊、重大傷病卡'),(32,2,'3個月內之重大傷病','3個月內未癒之重大傷病診斷證明'),(33,2,'學生','在學學生(博士班、空大、空專、進修學校、遠距教學等除外)'),(34,2,'孕婦','婦女懷孕'),(35,2,'獨自照顧直系老幼親屬','現獨自照顧65歲以上或6歲以下直系親屬，無法工作'),(36,2,'獨自照顧重大傷病親屬','現照顧無法自理生活身心障礙或患重病3個內無法痊癒之扶養親屬,無法工作'),(37,2,'其他','其他');
